import bridge from '../../images/GoldenGateBridge.jpeg';

const Home = () => {
    return (
        <div style={{display: 'flex', justifyContent:
        'center', alignItems: 'center', height: '90vh'}}>
            <img src={bridge} height="900" width="2000"/>

        </div>
    )
}

export default Home;
